INSERT INTO `inventory` VALUES (101,'Kopi Luwak',325.00,10,'This highly unusual coffee is  harvested by a tree-climbing marsupial living on Java, Sumatra, and Sulawesi called the Paradoxurus. Once the animal eats the beans, they  pass through the animals digestive system unaltered and are deposited (eventually) on the ground. Humans come along, pick up the undigested beans, clean them. The estimated total annual crop is less than 500 pounds. That, my friends, is the honest story of the coffees origin. Happy cupping!','C',83),(103,'Nicaragua Maragogipe',7.50,200,'Complexly fruitty and richly floral including papaya, lemon, and hints of flowers all ride a strong, balanced structure. Good body, smooth feel, sweet acidity.','C',128),(104,'Costa Rica Tarrazu',7.40,4000,'A perfect balance of acidity and body. Strictly hard bean Arabica from Costa Rica; medium body with a tangy aroma, lively acidity and rich overtones. Very similar to Jamaican Blue Mountain, but with less depth.','C',45),(107,'Costa Rica La Manita',9.50,5090,'A standard against which all other Strictly Hard Beans are judged against. Highly aromatic: sweet and caramelly aroma; full bodied; flavor is rich, complex; clean finish.','C',45),(110,'Sumatra Mandheling',5.60,3330,'An enticing favorite of many; syrupy, earthy, and deep. Grown at altitudes between 2,500 and 5,000 feet. Beans are dry processed with the husk removed by cleansing in hot water. Mandheling and Ankola are the finest varieties.','C',83),(113,'Assam Fancy 2nd Flush',8.80,315,'The largest tea-producing district in the world located in northeast India and known for the high quality of its black teas.  Assams are superb drinking; known for their rich, heavy, malty, very fragrant flavor.','T',41),(116,'Darjeeling Badamtam',8.10,512,'Black tea; A tea grown in an area of India that is northwest of Assam, known as Darjeeling. Darjeeling is grown in the foothills of the Himalayas at elevations of 1,000 to 6,000 feet. It has a complex aroma with a clear, brisk, and penetrating flavor. Darjeeling is truly one of the finest teas in the world!','T',82),(119,'Assam Tara TGFOP-1',13.30,429,'The largest tea-producing district in the world located in northeast India and known for the high quality of its black teas.  Assams are superb drinking; known for their rich, heavy, malty, very fragrant flavor.\nTGFOP stands for Tippy Golden Flowery Orange Pekoe This grade represents some of the most precious tea in the world. It is not uncommon to see whole leaves in their original state after brewing. The tip on these leaves can make up as much as a fourth of a whole leaf.','T',41),(122,'Ceylon Pekoe Labookelle',6.20,468,'Black tea; Sri Lanka, off the southeast coast of India, is the 2nd largest exporter of tea in the world. Strong and full, yet delicately flavored, Ceylon teas have a mildly sweet aroma reminiscent of honeysuckle.','T',163),(125,'Ceylon Supreme',7.00,291,'Black tea; Sri Lanka, off the southeast coast of India, is the 2nd largest exporter of tea in the world. Strong and full, yet delicately flavored, Ceylon teas have a mildly sweet aroma reminiscent of honeysuckle.','T',163),(128,'Ceylon Uva Highlands',8.20,419,'Black tea; Sri Lanka, off the southeast coast of India, is the 2nd largest exporter of tea in the world. Strong and full, yet delicately flavored, Ceylon teas have a mildly sweet aroma reminiscent of honeysuckle.','T',163),(131,'China Keemun',10.90,408,'Black tea; From the northern district of China, Keemun tea has been called the Burgundy of teas because of its superb bouquet. It is considered to be one of the finest teas in the world. Aromatic, with a rich, distinctive, concentrated flavor.','T',41),(134,'China Yunnan',10.30,443,'Black tea; tea from this province in southwestern China was first exported over 1,000 years ago. Originally a source of green tea, Yunnan in recent years has developed a black tea that is lighter and more delicately flavored than some of the traditional South China Congous.','T',41),(135,'Indian Mysore',12.50,400,'Sweet, midtoned, and intensely fragrant with a complex of sweet citrus and fresh-cut cedar. This striking aromatic combination hints at a sort of herb toned chocolate. Slightly heavy, bittersweet finish.','C',82),(137,'Darjeeling Namring',19.80,196,'Black tea; Assam, known as Darjeeling. Darjeeling is grown in the foothills of the Himalayas at elevations of 1,000 to 6,000 feet. It has a complex aroma with a clear, brisk, and penetrating flavor. Darjeeling is truly one of the finest teas in the world!','T',82),(140,'Kalgar-India',7.50,474,'Black tea;','T',82),(143,'Kenya Kaproret',9.90,515,'Black tea;','T',93),(146,'Mocha',13.10,750,'Bold, earthy, mild acidity. One of Arabia\'s oldest and best known coffees.','C',151),(152,'Zimbabwe',8.90,2100,'Delicate, fruity aroma; medium body; high level of acidity; moderately sweet flavor.','C',194),(155,'Ethiopia Mokas',7.40,4000,'Earthy and winey; indigenous to Ethiopia. Ethiopia is where coffee originated.','C',61),(158,'Guatemala Antigua',6.90,1400,'Elegant and complex. Contains hints of cocoa and spice. Grown in the mountainous Antigua region, this coffee is one of the most prized in Guatemala.','C',74),(161,'Yemen Mocha',5.60,3450,'Extremely complex aroma; spicy, cocoa, nutty, herbal and malty; full-bodied and very smooth; rich, winey and tart flavor.','C',191),(163,'Rwanda A',8.95,545,'Sweet, balanced, intense with deep dimension and a grand range of nuance ranging from floral top notes to mid tones of papaya and possibly pear. Superb aroma. An explosive entry, in the cup, with intense, almost contradictory impressions of sweetness, bitterness, acidity, and floral and cherry-toned fruit. Smooth, rich finish.','C',145),(164,'Jamaican Blue Mountain',22.00,4290,'Extremely mellow, sweet-tasting and delightfully aromatic; rich, full-bodied, well balanced; highland coffees grown in two estates: Wallensford Estate (the best) and Silverhill Estate; lowland coffees are used mainly for fillers and blending. Only about 80 tons of Wallensford Estate Blue Mountain are produced each year.','C',89),(167,'Ethiopia Sidamo',7.80,3440,'Floral aroma and lively acidity. This coffee is processed using the wet method to separate the cherry from the bean. Doing so produces a bright, lively acidity. Ethiopia is where coffee originated.','C',61),(170,'Berry Patch',12.90,354,'Fruit blend Tisanes;','T',68),(173,'Freesia\'s Garden',11.60,354,'Fruit blend Tisanes;','T',68),(176,'New Zealand Sunnyslopes',11.50,354,'Fruit blend Tisanes;','T',127),(179,'Passionfruit Fruit Blend',12.80,354,'Fruit blend Tisanes;','T',NULL),(182,'Columbia Bucaramanga Especial',7.40,2000,'Full bodied, medium acidity, nutty undertones; a soft-bean coffee with some of the character of fine Sumatran coffees.','C',42),(185,'Columbia Supremo',4.30,2550,'Full bodied; walnutty flavor. The top of the line for Colombian arabicas.','C',42),(188,'Vienna',3.90,2770,'Great with dessert. Has a deep, smoky finish. This coffee is processed using the wet method to separate the cherry from the bean. Doing so produces a bright, lively acidity. Consists of light roasted and dark roasted beans.','C',88),(191,'An Hui Silver Sprout',11.70,474,'Green tea;','T',41),(194,'Green Jakarta Clove',6.50,205,'Green tea;','T',82),(197,'Green Sencha Fukujya',19.00,463,'Green tea;','T',90),(200,'Gunpowder',8.30,141,'Green tea; Hand-rolled into tight little pellets, it brews a clear amber liquor with a tint of green, a light fragrance and a clean, lively, bright taste that is vaguely sweet and haunting. It has surprising body.','T',41),(202,'Bolivia Organic',12.95,560,'Lovely balance of dry and sweet acidy tones. More than balanced, integrated and smoothly complete in expression. Floral notes in the nose. In the cup, the cherr-toned fruit carries pleasing hints of a clean, sweet ferment.','C',25),(203,'Hunan Gu Zhang Mao Jian',22.70,444,'Green tea;','T',90),(206,'Japanese Cherry Sakura',12.20,273,'Green tea;','T',90),(209,'Morrocan Green Mint',8.30,501,'Green tea;','T',121),(212,'Pan Fired Green',7.20,324,'Green tea;','T',NULL),(215,'Guatemala Huehuetenago',7.40,2200,'Grown in red volcanic soil. A wild side version of Strictly Hard Bean Guatemalans.','C',74),(221,'Kilimanjaro',5.30,910,'Grown on the slopes of Mt. Kilimanjaro in Northern Tanzania. Mild aroma, deep rich body, delicate acidity.','C',171),(224,'New Guinea',7.40,1130,'Harmonious and smooth; toasty and sweet aroma; medium and smooth body; mellow and malty flavor. Coffee has grown on this island ever since Arabica typical plants were introduced in 1937.','C',136),(226,'Timor Maubesse Organic',7.50,800,'A sweet, lyric coffee with remarkable complexity. The aroma has distince leather notes, winy fruit, milk chocolate. The wine tones deepen and take on a smoky edge in the cup. Clean sweet, grape-like finish.','C',197),(227,'Euco Mint',6.30,354,'Herbal Tisane blends;','T',56),(230,'Garden Treat',7.00,354,'Herbal Tisane blends;','T',NULL),(233,'Lemon Ainger',7.10,226,'Herbal Tisane blends;','T',NULL),(236,'Rose Potpourri',6.90,443,'Herbal Tisane blends;','T',68),(239,'Sixteen Herb Mu',15.30,-45,'Herbal Tisane blends;','T',82),(242,'Orange Peel',7.70,343,'Herbal Tisanes; 1/4 inch cut','T',NULL),(245,'Eucalyptus',5.80,236,'Herbal Tisanes; broken leaf','T',56),(248,'Comfrey Leaves',7.20,54,'Herbal Tisanes; cut, sifted','T',56),(251,'Lemon Grass',3.80,-67,'Herbal Tisanes; cut, sifted','T',41),(254,'Chamomile Blossom',8.80,456,'Herbal Tisanes; whole flowers. Sweet and complex. Grown on the plains of the Nile valley. The world\'s best Chamomile!','T',56),(257,'Hibiscus',10.90,238,'Herbal Tisanes; whole flowers','T',116),(260,'Espresso Roast',7.10,2230,'Intense, hearty, satisfying.','C',NULL),(263,'Mexican Coatepec',6.70,1000,'It has a fine acidity, delicate body, and pleasantly mellow flavor. Fine Mexican coffees such as Coatepec now compare well with those from Central America.','C',116),(266,'Kona Extra Fancy',18.00,2740,'Mild, smooth, and delicately aromatic. A mellow roast. This coffee is processed using the wet method to separate the cherry from the bean. Doing so produces a bright, lively acidity. Grown on the slopes of Mauna Loa on the Kona district of the island of H','C',183),(269,'Passionfruit with Flowers',8.40,354,'Natural flavored tea;','T',93),(272,'Peach',8.00,354,'Natural flavored tea;','T',NULL),(275,'Raspberry',8.00,354,'Natural flavored tea;','T',NULL),(278,'Rumba',8.00,354,'Natural flavored tea;','T',NULL),(281,'Strawberry',7.70,354,'Natural flavored tea;','T',NULL),(284,'Vanilla with Vanilla Bean',9.60,354,'Natural flavored tea;','T',NULL),(287,'Mango',9.90,354,'Natural flavored tea;','T',93),(290,'Black Cherry',8.00,131,'Natural flavored tea;','T',NULL),(293,'Black Currant',8.60,545,'Natural flavored tea;','T',NULL),(296,'Blue Lady',8.80,354,'Natural flavored tea;','T',NULL),(299,'Nicaraguan Matagalpa',11.90,500,'Nicaraguan coffee is often difficult to describe. It has a decent body and acidity with a mild flavor. Though the consistency is irregular, the Nicaraguan coffees are excellent when compared to the best Central American coffees.','C',128),(300,'Honduras Intibuca',12.50,700,'Dry and forceful. The acidith is intense but sweet. The fruit is crisply austere: sauvignon blanc wine grapes, black currant. A challenging coffee that commands rather then seduces.','C',79),(302,'Formosa Silvertip Oolong',44.50,106,'The best oolong tea and one of the finest teas of any kind, marked by a piquant pungency and an almost fruity flavor in the cup.','T',41),(305,'Fujian Oolong Ti Kuan Yin',15.20,511,'China oolong tea tends to be rough in comparison to Formosa oolong yet it can be brisk and rich in flavor.','T',90),(308,'Orange Blossom Oolong',10.20,444,'China oolong tea tends to be rough in comparison to Formosa oolong yet it can be brisk and rich in flavor.','T',41),(311,'Ethiopia Yergacheffe',8.90,5600,'Piquant and having a sweet, fruity taste. Full toasty, dramatic, and caramelly aroma. Body is medium to mellow. Coffee is processed using the wet method to separate the cherry from the bean. Doing so produces a bright, lively acidity. Ethiopia is where coffee was born.','C',61),(314,'Mocha Java',6.40,1280,'Powerful, bold, and exotic. Worlds oldest and most well known blend: Ethiopian Mocha Harrar blended perfectly with Java Estate. Then, the beans are roasted dark. The  blend combines the spicy full body of Estate Java with the piquancy and pungent aroma of Arabian Mocha.','C',83),(317,'Kenya AA',8.10,4240,'Rich bourbon-like, bright, sweet with hints of black currant; medium bodied and winey acidity; rich, bright, sweet with hints of black currant.','C',93),(320,'Yukon Blend',6.70,3000,'Robust and earthy; lingering richness.','C',NULL),(323,'Sulawesi Peaberry',10.80,6000,'Smooth, buttery, refined, and a true treasure. This exotic bean is full bodied and very well rounded; it has a tangy touch of acidity not usually found in a Sulawesi coffee.','C',83),(326,'Java',4.70,3640,'Spicy sweetness and strong to heavy bodied and little acidity. An aged Java has a creamy flavor of toasted marshmallow (honestly)!','C',83),(332,'Celebes Kalossi',10.40,2480,'Sweet and fruity aroma; smooth and full bodied; flavor is subtle, nutty and cocoa; smooth, lingering finish.','C',83),(335,'Brazil Sul De Minas Cerra',7.40,3000,'Sweet flavor; most varieties are relatively non-distinguishable; thus, Brazil has a relatively small portion of the gourmet coffee market.  However, Brazil is the worlds leading coffee exporter, producing nearly 35 percent of the worlds coffee.','C',28),(338,'Italian Roast',8.20,2250,'Sweet, dark, spirited; rich caramel-like taste.','C',NULL),(341,'Haiti Strictly High Grown Washed',8.00,2570,'Sweet, mellow, fair-bodied coffee with a rich flavor. Coffee cultivation was started by the Jesuits in 1715. Best grade is strictly high grown washed, and the second best is high grown washed.','C',78),(344,'Brazil Bourbon Santos',3.80,5470,'Sweet, neutral flavor; most varieties are relatively non-distinguishable; thus, Brazil has a relatively small portion of the gourmet coffee market. However, Brazil is the worlds leading coffee exporter, producing nearly 35 percent of the worlds coffee.','C',28),(347,'Tanzania Moshi',8.60,2500,'Tanzanian coffees are known for their sharp, winey, and rich flavor. Moshi and Kilimanjaro are two of the est. Most coffees are grown on the slopes of Mt. Kilimanjaro and Mt. Mero on the border of Kenya.','C',171),(350,'Chanchamayo',13.10,4500,'The Chanchamayos are often as good as the best Central American coffees. They are medium bodied with mild acidity but flavorful. Quality is not always uniform, because several plantations have changed over to cocoa farming.','C',138),(353,'English Breakfast',13.70,354,'Traditional black tea blend; full-bodied and lively blend of high-grown and medium-grown black teas from Ceylon\'s original Scottish tea estates founded in the 1860s.','T',82),(356,'Chai',12.90,190,'A blend of high-grown Ceylon black teas and Sri Lankan Chai spices. The flavors of cinnamon, ginger, cardamom, pepper, cloves and nutmeg create an exceptional tea.','T',41),(359,'Earl Grey',8.10,184,'A rich blend of Broken Orange Pekoe teas from Ceylon flavored with the essence of the bergamot orange. It is a full-bodied black tea with satisfying, delicate citrus flavors. In the early 18th century, Charles Earl Grey obtained the recipe for the tea and returned to England with it.','T',41),(362,'Guangxi Guihua',8.40,148,'Traditional tea;','T',90),(365,'Irish Blend',7.50,202,'Traditional tea; It is a blend of Assam and Ceylon tea. Quite compatible with milk and sugar.','T',41),(368,'Jasmine',9.50,71,'Flowery and aromatic. An elegant and unique cup of tea. Green tea scented with jasmine dates back to the Sung Dynasty in China.','T',90),(371,'Lapsang Souchong',9.10,541,'A China tea with a distinct smoky-tarry scent and flavor from the Kukien province of southern China. The tea is actually smoked over a fire to impart this flavor. This tea is considered an acquired taste for most.','T',41),(374,'Queen Mary blend',8.40,260,'A combination of choice Darjeeling tea containing mainly Orange Pekoe grades.','T',41),(377,'Russian',9.90,380,'This tea is grown in the Transcaucasian region of Russia mainly in Azerbaidzhan and Georgia. Most is consumed domestically but small amounts are exported to European countries. It is a long leaf tea and the cup is likely to be thin, light, and taste best when served with a slice of lemon (the Russian manner).','T',144),(379,'Panama La Torcaza',8.50,780,'Intense but balanced acidity, medium body, tartly sweet fruit notes that soften toward chocolate in the finish.','C',135),(380,'Ethiopia Harrar',9.30,4330,'Untamed and wild; has a berry-like flavor; nutty and spicy aroma; winey high notes; medium to full bodied with a tart flavor. Ethiopia is where coffee originated.','C',61),(383,'French Roast',5.50,-40,'Very dark roast; smoky, intense and satisfying.','C',NULL),(386,'Almond Amaretto',7.60,1330,'Usually the base coffee is Brazilian.','C',NULL),(389,'Apricot Cordial',5.60,-30,'Usually the base coffee is Brazilian.','C',NULL),(392,'Chocolate Brandy',5.70,5530,'Usually the base coffee is Brazilian.','C',NULL),(395,'Chocolate Cinnamon',5.20,2500,'Usually the base coffee is Brazilian.','C',NULL),(398,'Chocolate Hazelnut',5.90,5090,'Usually the base coffee is Brazilian.','C',NULL),(401,'Chocolate Macadamia',4.50,4740,'Usually the base coffee is Brazilian.','C',NULL),(404,'Chocolate Mint',5.80,-230,'Usually the base coffee is Brazilian.','C',NULL),(407,'Chocolate Raspberry',4.50,1800,'Usually the base coffee is Brazilian.','C',NULL),(410,'Cinnamon',4.50,5340,'Usually the base coffee is Brazilian.','C',NULL),(413,'Coconut Cream',5.60,3210,'Usually the base coffee is Brazilian.','C',NULL),(416,'Dark Chocolate Almond',5.60,1850,'Usually the base coffee is Brazilian.','C',NULL),(419,'Dutch Chocolate',5.80,2230,'Usually the base coffee is Brazilian